import './App.css';
import React, {useRef} from 'react';

import "./CSS/index";
import { Navbar } from "./Layout/index";
import {Hello, Resume, Portfolio, Contact} from "./Pages/index"

const App = () => {
  const myRefResume = useRef(null)
  return (
    <div className="App">
      <Navbar referencia={myRefResume}/>
      <Hello />
      <Resume />
      <Portfolio />
      <Contact />
    </div>
  );
}

export default App;
